from sympy import isprime
def composite(n): return n >= 4 and not isprime(n)
def a(n):
  an = n + 4
  while not (composite(an) and composite(an-n)): an += 1
  return an
print([a(n) for n in range(67)]) # _Michael S. Branicky_, Apr 09 2021

